import { makeStyles } from '@material-ui/styles'
import React from 'react'
import TextFieldComp from '../../components/TextFieldComp'

function AddNewServingScreen() {


    const useStyles = makeStyles(theme => ({
        title: {
            ...theme.typography.content,
            textAlign: 'center',
            fontSize: '2.5rem',
            marginTop: '20px'
        },
        formDiv: {
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            height: 'auto',
            width: '400px',
            backgroundColor: theme.palette.secondary.light,
            marginTop: '30px',
            marginBottom: '30px',
            borderRadius: '15px',
            flexDirection: 'column',
            paddingTop: '50px',
            paddingBottom: '50px',
        },
        label: {
            ...theme.typography.title,
            fontSize: '1.5rem'
        },
        btn: {
            ...theme.buttonDef
        },
        btnser: {
            ...theme.buttonDef,
            marginLeft: 'auto',
            marginRight: '20px'
        },
        btnLeft: {
            poaition: 'relative',
            marginRight: 'auto',
            marginLeft: '20px'
        }
    }))
    const classes = useStyles()
    return (
        <div>
            <p className={classes.title} >Add new Serving</p>
            <div className={classes.formDiv} >

                <TextFieldComp
                    class={classes.label}
                    name='Username: '
                    placeholder={user.username}
                />
                <TextFieldComp
                    class={classes.label}
                    name='Name: '
                    placeholder={details?.name}
                />
                <TextFieldComp
                    class={classes.label}
                    name='Address: '
                    placeholder={details?.address}
                />
                <TextFieldComp
                    class={classes.label}
                    name='City: '
                    placeholder={details?.city}
                />
                <TextFieldComp
                    class={classes.label}
                    name='Country: '
                    placeholder={details?.country}
                />
                <TextFieldComp
                    class={classes.label}
                    name='State: '
                    placeholder={details?.state}
                />
                <TextFieldComp
                    class={classes.label}
                    name='Pincode: '
                    placeholder={details?.pincode}
                />
                <Button variant='contained' color='primary'
                    className={classes.btn} onClick={updateProfile} >Update Profile</Button>
                <Link to='/rest/password-change' style={{ marginTop: '20px' }} >Change Password</Link>
            </div>
        </div>
    )
}

export default AddNewServingScreen
